,"execution_count":43,"outputs":[{"output_type":"display_data","data":{"text/plain":"Coordinate Reference System:\n  User input: EPSG:32616 \n  wkt:\nPROJCRS[\"WGS 84 / UTM zone 16N\",\n    BASEGEOGCRS[\"WGS 84\",\n        DATUM[\"World Geodetic System 1984\",\n            ELLIPSOID[\"WGS 84\",6378137,298.257223563,\n                LENGTHUNIT[\"metre\",1]]],\n        PRIMEM[\"Greenwich\",0,\n            ANGLEUNIT[\"degree\",0.0174532925199433]],\n        ID[\"EPSG\",4326]],\n    CONVERSION[\"UTM zone 16N\",\n        METHOD[\"Transverse Mercator\",\n            ID[\"EPSG\",9807]],\n        PARAMETER[\"Latitude of natural origin\",0,\n            ANGLEUNIT[\"degree\",0.0174532925199433],\n            ID[\"EPSG\",8801]],\n        PARAMETER[\"Longitude of natural origin\",-87,\n            ANGLEUNIT[\"degree\",0.0174532925199433],\n            ID[\"EPSG\",8802]],\n        PARAMETER[\"Scale factor at natural origin\",0.9996,\n            SCALEUNIT[\"unity\",1],\n            ID[\"EPSG\",8805]],\n        PARAMETER[\"False easting\",500000,\n            LENGTHUNIT[\"metre\",1],\n            ID[\"EPSG\",8806]],\n        PARAMETER[\"False northing\",0,\n            LENGTHUNIT[\"metre\",1],\n            ID[\"EPSG\",8807]]],\n    CS[Cartesian,2],\n        AXIS[\"(E)\",east,\n            ORDER[1],\n            LENGTHUNIT[\"metre\",1]],\n        AXIS[\"(N)\",north,\n            ORDER[2],\n            LENGTHUNIT[\"metre\",1]],\n    USAGE[\n        SCOPE[\"unknown\"],\n        AREA[\"World - N hemisphere - 90¬∞W to 84¬∞W - by country\"],\n        BBOX[0,-90,84,-84]],\n    ID[\"EPSG\",32616]]"},"metadata":{}}]},{"cell_type":"code","source":"# Change vehicle.points to the same projection \nvehicle.points <- st_transform(vehicle.points, 32616)\nst_crs(vehicle.points)","metadata":{"execution":{"iopub.status.busy":"2024-04-18T05:42:17.567494Z","iopub.execute_input":"2024-04-18T05:42:17.569216Z","iopub.status.idle":"2024-04-18T05:42:17.612258Z"},"trusted":true},"execution_count":44,"out